import React from 'react';

const Action = ({ action }) => {
  return (
    <>
      {action.map((action) => {
          return (
            <li>
                <h5 className="bg-secondary text-white p-2">{action.name}</h5>
                <p>{action.description}</p>
            </li>
          );
      })}
    </>
  );
}

export default Action;
